import styles from "./index.module.scss";
import { MainInfo } from "./MainInfo";

export const Footer = () => {
  return (
    <div className={styles.container}>
      <MainInfo />
      <div className={styles.links}>
        <h4>Links</h4>
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
          <li>4</li>
        </ul>
      </div>
      <div className={styles.contacts}>
        <h4>contacts</h4>
      </div>
      <div className={styles.social}>
        <h4>social</h4>
      </div>
    </div>
  );
};
